import React, { Component } from 'react'
import './ProductList.css'
import Product from '../Product/Product'

// DUMMY DATA FOR THE STORE
const data = [
  { name: 'Polo T-Shirt', price: '5,000', image: 'https://raw.githubusercontent.com/itbruno/productpreview/master/assets/img/t-shirt.jpg' },
  { name: 'iPhone 11 Max', price: '2,100,000', image: 'data:image/jpeg;base64,' },
  { name: 'Creed Perfume', price: '200,000', image: 'data:image/jpeg;base64,' },
  { name: 'Rolex', price: '3,000,000', image: 'data:image/jpeg;base64,' },
  { name: 'PS4', price: '800,000', image: 'data:image/jpeg;base64,' },
  { name: 'Men\'s shoes', price: '20,000', image: 'data:image/jpeg;base64,' }
]

class ProductList extends Component {
  render () {
    const ProductItems = data.map((item, i) => {
      return <Product key={i} name={item.name} price={item.price} image={item.image} />
    })
    return (
      <div class='grid'>
        {ProductItems}
      </div>
    )
  }
}

export default ProductList
